const Results=({suggestedNames})=>{
    const suggestedNameJSX=suggestedNames.map((suggestedName) => {
        return <p>{suggestedName}</p>;
    })
    return(
        <div>
            <p>
                {suggestedNameJSX}
            </p>
        </div>
    );

};
export default Results;
